function submitPressed(e){e.className="active";var t=document.getElementById("signin-form"),n=new XMLHttpRequest,o=new Date;n.onload=function(){var t=820-((new Date).getTime()-o.getTime());t=t<0?0:t,setTimeout(function(){n.status>=200&&n.status<300?(console.log("worked !!!"),e.className="fine",setTimeout(function(){window.location="/"},300)):(console.log("request failed"),e.className="error")},t)},n.open(t.getAttribute("method")||"POST",t.getAttribute("action")),n.setRequestHeader("Content-Type","application/json"),n.send(JSON.stringify({user:{email:document.getElementById("email").value,password:document.getElementById("password").value}}))}